import React, { Component } from "react";

class Home extends Component {
  render() {
    return (
      // <div>
      //   <h2>Welcome to the world of covid fighters!</h2>
      //   <p>This is a website for tracking the open/closed status of restaurants, 
      //     healthcare facilities, and grocery stores during covid-19.</p>


      // </div>
      <main role="main" class="inner cover">
      <div class="opaque">
      <h1 class="cover-heading">Welcome to the World of Covid Fighters!</h1>
      <p class="lead">Our mission is to inform you about threatened and endangered animals. This
      website will give you vital information about what animals are at risk of extinction, where they
      can be found, and what their ecosystems are like. Our hope is that you use this information to
      make yourself aware of the threat to animals all around the world and to find ways to contribute
      to conservation efforts that will allow these animals to thrive for generations to come.</p>
      </div>
      <p class="lead">
        <a href="animals.html" class="btn btn-lg btn-secondary">Learn More</a>
      </p>
    </main>

    );
  }
}

export default Home;
